import './App.css';
import Home from './Components/Home/Home';
import ProductsData from "./Data/Productos"
import Cards from './Components/Cards/Cards';

function App() {

return (

  <div className="App">
    {ProductsData.map( products => (

    <Cards img={products.img} 
    key={products.id} 
    name={products.name} price={products.price} ammount={products.ammount} descripcion={" "} /> 

    ))}



  <Home /> 



</div>
)}

export default App;
